  //     add_to: 'airport',
  //     luggage: 8,
  //     price: 553,
  //     other: 'aaa',
  //     contact: '667'
  //   }
  // ]
  return (
    <div className={style.item_container}>
      {order_list.length && props.user.name ? <List order_list={order_list} /> : <Empty />}
    </div>
  )
}
export default connect(
  state => state,
  {}
)(Index)
